import React from "react";

const Shopping = () => {
  const websites = [
    { name: "Amazon (Baby Section)", url: "https://www.amazon.com/baby" },
    { name: "FirstCry", url: "https://www.firstcry.com" },
    { name: "BabyCenter Store", url: "https://store.babycenter.com" },
    { name: "Huggies Store", url: "https://www.huggies.com" },
  ];

  return (
    <div className="shopping-container">
      <h2>Infant Care Shopping Websites</h2>
      <ul>
        {websites.map((site) => (
          <li key={site.name}>
            <a href={site.url} target="_blank" rel="noopener noreferrer">
              {site.name}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Shopping;
